import React, { Component } from 'react'
import logo from '../images/logo.svg'
import {FaAlignRight} from 'react-icons/fa'
import {Link} from 'react-router-dom'


export default class Navbar extends Component {
    state = {
        isOpen: false
    }

    handleToggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        })
    }
    render() {
        return (
            <nav className="navbasr">
                <div className="nav-centers">
                    <div className="nav-headser">
                        <Link to="/">
                            <img src={logo} alt="Beach Resort" />
                        </Link>
                        <button type="button" className="nasv-btn" onClick={this.handleToggle}>
                            <FaAlignRight className="navs-icon"/>
                        </button>
                    </div>
                <ul className={this.state.isOpen?"nav-slinks show-nav":"nav-linkss"}>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/rooms">Rooms</Link>
                    </li>
                </ul>
                </div>
            </nav>
        )
    }
}
